pragma solidity =0.6.6;

import './UniswapV2Library.sol';
import './SushiswapV2Library.sol';
import './interfaces/IUniswapV2Router02.sol';
import './interfaces/IUniswapV2Pair.sol';
import './interfaces/IERC20.sol';
//import './libraries/SafeMath.sol';

contract FlashLoanerEth {
  using SafeMath for uint;

  address immutable factory;
  address immutable sushifactory;
  //address sushiaddress = 0xC0AEe478e3658e2610c5F7A4A2E1777cE9e4f2Ac;
  //uint constant deadline = 10 days;

  IUniswapV2Router02 immutable sushiRouter;
  //IUniswapV2Pair immutable uniPair;

  constructor(address _factory, address uniPair, address _sushiRouter) public {
    factory = _factory;  
    sushiRouter = IUniswapV2Router02(_sushiRouter);
    sushifactory = uniPair; 
  }

  function uniswapV2Call(address _sender, uint _amount0, uint _amount1, bytes calldata _data) external {
      address[] memory path = new address[](2);
      address[] memory path_get = new address[](2);

      uint amountToken = _amount0 == 0 ? _amount1 : _amount0;

      address token0 = IUniswapV2Pair(msg.sender).token0();
      address token1 = IUniswapV2Pair(msg.sender).token1();

      require(msg.sender == UniswapV2Library.pairFor(factory, token0, token1), "Unauthorized"); 
      require(_amount0 == 0 || _amount1 == 0);

      path_get[0] = _amount0 == 0 ? token0 : token1;
      path_get[1] = _amount0 == 0 ? token1 : token0;

      path[0] = _amount0 == 0 ? token1 : token0;
      path[1] = _amount0 == 0 ? token0 : token1;

      IERC20 token = IERC20(_amount0 == 0 ? token1 : token0);
      IERC20 return_token = IERC20(_amount0 == 0 ? token0 : token1);

      token.approve(address(sushiRouter), amountToken);

      // no need for require() check, if amount required is not sent sushiRouter will revert
      uint amountRequired = UniswapV2Library.getAmountsIn(factory, amountToken, path_get)[0];
      // uint amountReceived = sushiRouter.swapExactTokensForTokens(amountToken, amountRequired, path, address(this), uint(-1))[1];
      uint amountReturned = sushiRouter.swapTokensForExactTokens(amountRequired, amountToken, path, address(msg.sender), uint(-1))[0];

      require(amountToken > amountReturned, "No Profit");

      // YEAHH PROFIT
      token.transfer(_sender, amountToken - amountReturned);
  }


  function guessProfit(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (uint profit){
      address[] memory path = new address[](2);
      address[] memory path_get = new address[](2);

      uint amountToken = _amount0 == 0 ? _amount1 : _amount0;

      address token0 = IUniswapV2Pair(uniPair).token0();
      address token1 = IUniswapV2Pair(uniPair).token1();

      require(uniPair == UniswapV2Library.pairFor(factory, token0, token1), "Unauthorized"); 
      //require(_amount0 == 0 || _amount1 == 0);

      path_get[0] = _amount0 == 0 ? token0 : token1;
      path_get[1] = _amount0 == 0 ? token1 : token0;

      path[0] = _amount0 == 0 ? token1 : token0;
      path[1] = _amount0 == 0 ? token0 : token1;

      // no need for require() check, if amount required is not sent sushiRouter will revert
      uint amountRequired = UniswapV2Library.getAmountsIn(factory, amountToken, path_get)[0];
      uint amountReturned = SushiswapV2Library.getAmountsIn(sushifactory, amountRequired, path)[0]; 

      profit = amountToken > amountReturned ? amountToken.sub(amountReturned) : 0;

  } 


  function getUniRequired(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (uint re){
      address[] memory path = new address[](2);
      address[] memory path_get = new address[](2);

      uint amountToken = _amount0 == 0 ? _amount1 : _amount0;

      address token0 = IUniswapV2Pair(uniPair).token0();
      address token1 = IUniswapV2Pair(uniPair).token1();

      require(uniPair == UniswapV2Library.pairFor(factory, token0, token1), "Unauthorized"); 
      //require(_amount0 == 0 || _amount1 == 0);

      path_get[0] = _amount0 == 0 ? token0 : token1;
      path_get[1] = _amount0 == 0 ? token1 : token0;

      path[0] = _amount0 == 0 ? token1 : token0;
      path[1] = _amount0 == 0 ? token0 : token1;

      // no need for require() check, if amount required is not sent sushiRouter will revert
      re = UniswapV2Library.getAmountsIn(factory, amountToken, path_get)[0];

  }  

  function getSushiReturned(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (uint re){
      //require(sushiaddress == factorySushi, "Sushi address wrong.");

      address[] memory path = new address[](2);
      address[] memory path_get = new address[](2);

      uint amountToken = _amount0 == 0 ? _amount1 : _amount0;

      address token0 = IUniswapV2Pair(uniPair).token0();
      address token1 = IUniswapV2Pair(uniPair).token1();

      require(uniPair == UniswapV2Library.pairFor(factory, token0, token1), "Unauthorized"); 
      //require(_amount0 == 0 || _amount1 == 0);

      path_get[0] = _amount0 == 0 ? token0 : token1;
      path_get[1] = _amount0 == 0 ? token1 : token0;

      path[0] = _amount0 == 0 ? token1 : token0;
      path[1] = _amount0 == 0 ? token0 : token1;

      // no need for require() check, if amount required is not sent sushiRouter will revert
      uint amountRequired = UniswapV2Library.getAmountsIn(factory, amountToken, path_get)[0];
      re = SushiswapV2Library.getAmountsIn(sushifactory, amountRequired, path)[0];

  }

  function getUniReturned(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (uint re){
      address[] memory path = new address[](2);
      address[] memory path_get = new address[](2);

      uint amountToken = _amount0 == 0 ? _amount1 : _amount0;

      address token0 = IUniswapV2Pair(uniPair).token0();
      address token1 = IUniswapV2Pair(uniPair).token1();

      require(uniPair == UniswapV2Library.pairFor(factory, token0, token1), "Unauthorized"); 
      //require(_amount0 == 0 || _amount1 == 0);

      path_get[0] = _amount0 == 0 ? token0 : token1;
      path_get[1] = _amount0 == 0 ? token1 : token0;

      path[0] = _amount0 == 0 ? token1 : token0;
      path[1] = _amount0 == 0 ? token0 : token1;

      // no need for require() check, if amount required is not sent sushiRouter will revert
      uint amountRequired = UniswapV2Library.getAmountsIn(factory, amountToken, path_get)[0];
      re = UniswapV2Library.getAmountsIn(factory, amountRequired, path)[0];

  }  

  function getaddress(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (address re1, address re2){
      address re1 = IUniswapV2Pair(uniPair).token0();
      address re2 = IUniswapV2Pair(uniPair).token1();
  }

  function getaddressR(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (address re1, address re2){
      re1 = IUniswapV2Pair(uniPair).token0();
      re2 = IUniswapV2Pair(uniPair).token1();
  }

  function getaddressS(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (address re){
      address re1 = IUniswapV2Pair(uniPair).token0();
      address re2 = IUniswapV2Pair(uniPair).token1();
      re = SushiswapV2Library.pairFor(factorySushi, re1, re2);
  }

  function getaddressU(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (address re){
      address re1 = IUniswapV2Pair(uniPair).token0();
      address re2 = IUniswapV2Pair(uniPair).token1();
      re = UniswapV2Library.pairFor(factorySushi, re1, re2);
  }

  function getaddressS2(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (address re){
      address re1 = IUniswapV2Pair(uniPair).token0();
      address re2 = IUniswapV2Pair(uniPair).token1();
      re = SushiswapV2Library.pairFor(sushifactory, re1, re2);
  }

  function getaddressF(address factorySushi, address uniPair, uint _amount0, uint _amount1) external view returns (address re1, address re2){
      re1 = factorySushi;
      re2 = sushifactory;
  }

}
